import React from 'react'

export const Categories = () => {
    const constructor = (props) => {
        state = {
            categories: [
                {
                    key: 'all',
                    name: 'Всё'
                },
                {
                    key: 'motorbike',
                    name: 'Мотоциклы'
                },
                {
                    key: 'moped',
                    name: 'Мопеды'
                },
                {
                    key: 'scooter',
                    name: 'Скутеры',
                },
                {
                    key: 'ATV',
                    name: 'Квадроциклы'
                }
            ]
        }
    }

    return (
        <div className='categories'>
            {state.categories.map(el => (
                <div key={el.key}>{el.name}</div>
            ))}
        </div>
    )
}

export default Categories
